export default function ViewStudent({user}) {
    return (

        <div className="card d-flex" style={{width:'18rem' , justifyContent}}>
        <div className="card-body" >
            <p>NAME : {user.name}</p>
            <p>DEPARTMENT : {user.department}</p>
            <p>BATCH : {user.batch}</p>
            <p>BLOOD GROUP : {user.blood}</p>
        </div> </div>













    );
}
